                    "zIndex": 11,
                    "width": "419.97",
                    "code": "<!DOCTYPE html>\r<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\r\t<!--LIBRERIA PER INTERAGIRE CON KLYNT -->\r\t<script src=\"https://cdn.jsdelivr.net/gh/Klynt/Klynt-Player/Player/js/api/KlyntAPI.js\" type=\"text/javascript\"></script>\r    <script src=\"https://unpkg.com/sweetalert/dist/sweetalert.min.js\"></script>\r\t<!-- STILE -->\r\t<style>\r    .swal-button {\r     background-color: red;\r     }\r    .swal-button:not([disabled]):hover {\r     background-color: lightgrey;\r     }\r\t#frame-body {\r          justify-content: center;\r          align-items: center;\r\t}\r\tinput{\r\t\twidth: 100%;\r\t\tborder-top-color: transparent;\r\t\tborder-left-color: transparent;\r\t\tborder-right-color: transparent;\r\t\tfont-size: 24px;\r\t}\r\tinput:focus{\r\t\toutline: none;\r\t}\r\r\t#frame-body button {\r\t\tpadding: 8px;\r\t\tmargin-top: 16px;\r\t\tborder: none;\r\t\tbackground: #08457e;\r\t\tcolor: white;\r\t\twidth: 90%\r\t}\r\r    .maintimer{\r        margin: 30px;\r        width: 100%;\r        justify-content: center;\r        text-align: center;\r        color: rgb(161, 34, 34);\r        line-height: normal;\r        font-size: 50px;\r        font-family: \"Verdana\";\r    }\r\r    .digittimer{\r        color: rgb(231, 228, 218);\r        background: rgb(161, 34, 34);\r        margin: 4px;\r        font-size: 50px;\r    }\r\r    .colontimer {\r        position: relative;\r        top: -.1em;\r    }\r\r    .texttimer{\r        font-size: 15px;\r    }\r\t</style>\r</head>\r<body>\r<div id=\"frame-body\" style=\"display:flex; flex-direction: column;\">\r<div class=\"maintimer\" style=\"display:flex;flex-direction: row;\">\r    <div>\r        <div>\r            <span class=\"digittimer\" id=\"time-d-0\">0</span><span class=\"digittimer\" id=\"time-d-1\">0</span>\r        </div>\r        <div class=\"texttimer\">\r            DAYS\r        </div>\r    </div>\r    <div class=\"colontimer\">\r        :\r    </div>\r    <div>\r        <div>\r            <span class=\"digittimer\" id=\"time-h-0\">0</span><span class=\"digittimer\" id=\"time-h-1\">0</span>\r        </div>\r        <div class=\"texttimer\">\r            HOURS\r        </div>\r    </div>\r    <div class=\"colontimer\">\r        :\r    </div>\r    <div>\r        <div>\r            <span class=\"digittimer \" id=\"time-m-0\">0</span><span class=\"digittimer \" id=\"time-m-1\">0</span>\r        </div>\r        <div class=\"texttimer\">\r            MINUTES\r        </div>\r    </div>\r    <div class=\"colontimer\">\r        :\r    </div>\r    <div>\r        <div>\r            <span class=\"digittimer \" id=\"time-s-0\">0</span><span class=\"digittimer \" id=\"time-s-1\">0</span>\r        </div>\r        <div class=\"texttimer\">\r            SECONDS\r        </div>\r    </div>\r</div>\r\r<br>\r<br>\r<br>\r\r\t<!-- CODICE JAVASCRIPT -->\r\t<script>\r\r    function show(){\r        var distance = new Date(\"2023/06/09 19:00\") - new Date();\r        if (distance < 0){\r            distance = 0;\r        }\r        var days = Math.floor(distance / (1000 * 60 * 60 * 24));\r        var hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));\r        var minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));\r        var seconds = Math.floor((distance % (1000 * 60)) / 1000);\r\r        document.getElementById(\"time-d-0\").innerHTML = Math.floor(days / 10) % 10;\r        document.getElementById(\"time-d-1\").innerHTML = (days) % 10;\r        document.getElementById(\"time-h-0\").innerHTML = Math.floor(hours / 10) % 10;\r        document.getElementById(\"time-h-1\").innerHTML = (hours) % 10;\r        document.getElementById(\"time-m-0\").innerHTML = Math.floor(minutes / 10) % 10;\r        document.getElementById(\"time-m-1\").innerHTML = (minutes) % 10;\r        document.getElementById(\"time-s-0\").innerHTML = Math.floor(seconds / 10) % 10;\r        document.getElementById(\"time-s-1\").innerHTML = (seconds) % 10;\r    }\r\r    show();\r    var timer_2 = setInterval(function () {\r        show();\r    }, 1000);\r\t</script>\r</div>\r</body></html>",
